width: 100vw;
height: 100vh;
display: flex;
justify-content: center;
align-items: center;

& p {
font-size: 80px;
color: ghostwhite;
}

`;

export const ErrorBox = styled.div`

`;

const ErrorPage = () => {
    return <>
        <Box>
            <ErrorBox>
            <p>Error 4</p><span><LogoJacotStudio/></span><p>4</p>
            </ErrorBox>
